def Alchemy(C, N):
    return 'N' if abs(C.count('A') - C.count('B')) > 1 else 'Y'

if __name__ == "__main__":
    T = int(input())
    for i in range(T):
        N = int(input())
        C = input()
        print("Case #{}:".format(i+1), end=" ")
        print(Alchemy(list(C), N))


